import pic1 from "../images/kyochon.png";

const GoodRestaurants = () => {
  return (
    <div className="h-[80px] w-[125px] bg-cyan-300 border-[4px] border-[#2D2D32] ml-[20px] bg-clip-border rounded-tl-lg ">
      <img src={pic1} alt="pic" className="bg-auto" />
      <div className="h-[100px] w-[125px] bg-fuchsia-600 border-[2px] border-[#2D2D32] ml-[-2px] mt-[100px] rounded-bl-lg">
        <img src="" alt="pic" className="" />
        <div className="h-[202px] w-[225px] bg-fuchsia-600 border-[2px] border-[#2D2D32] ml-[125px] mt-[-104px] rounded-r-lg"></div>
        <img src="" alt="pic" />
      </div>
    </div>
  );
};

export default GoodRestaurants;
